name <String> Name that is used in selectors as a prefix, e.g. {name: 'foo'} enables foo=myselectorbody selectors. May only contain [a-zA-Z0-9_] characters. script <String|Path> Script that evaluates to a selector engine instance. options <Selectors.RegisterOptions> withContentScript <boolean> Whether to run this selector engine in isolated JavaScript environment. This environment has access to the same DOM, but not any JavaScript objects from the frame's scripts. Defaults to false. Note that running as a content script is not guaranteed when this engine is used together with other registered engines. An example of registering selector engine that queries elements based on a tag name: // Script that evaluates to a selector engine instance. String createTagNameEngine = "{
" + " // Returns the first element matching given selector in the root's subtree.
" + " query(root, selector) {
" + " return root.querySelector(selector);
" + " },
" + " // Returns all elements matching given selector in the root's subtree.
" + " queryAll(root, selector) {
" + " return Array.from(root.querySelectorAll(selector));
" + " }
" + "}"; // Register the engine. Selectors will be prefixed with "tag=". playwright.selectors().register("tag", createTagNameEngine); Browser browser = playwright.firefox().launch(); Page page = browser.newPage(); page.setContent("<div><button>Click me</button></div>"); // Use the selector prefixed with its name. ElementHandle button = page.querySelector("tag=button"); // Combine it with other selector engines. page.click("tag=div >> text="Click me""); // Can use it in any methods supporting selectors. int buttonCount = (int) page.evalOnSelectorAll("tag=button", "buttons => buttons.length"); browser.close();
